const makeSequence = function(first, others){
  const array = [first];
  if(!others){
    return array;
  }
  for(let i = 0; i < others.length; i++){
    let elm = others[i];
    if(!isSu(elm)){
      elm = makeSu(elm);
    }
    array.push(elm);
  }
  return array;
}

